import React, {Component} from "react";
import Button from "@mui/material/Button";
import Modal from "@mui/material/Modal";
import Box from "@mui/material/Box";
import ReactJson from "react-json-view";
import Grid from "@mui/material/Grid";
import { styled } from '@mui/material/styles'
import DeleteObject from "./DeleteObject";
import {modalStyle} from "./util";
import "./ViewObject.css"


class ViewObject extends Component {
    constructor(props) {
        super(props)
        this.state = {
            objectKind: this.props.objectKind,
            objectName: this.props.objectName,
            objectOriginalJSON: this.props.objectOriginalJSON,

            modalOpen: false,
        };
    }

    handleModalOpen = () => {
        this.setState({modalOpen: true})
    }
    handleModalClose = () => {
        this.setState({modalOpen: false})
    }

    render() {
        const {objectName, objectKind, objectOriginalJSON} = this.state
        const {handleSendRequest} = this.props
        return (
            <div className='Modal-ViewObject'>
                <Button variant="outlined" onClick={this.handleModalOpen} size="small">
                    Setting
                </Button>

                <Modal
                    open={this.state.modalOpen}
                    onClose={this.handleModalClose}
                    aria-labelledby="modal-modal-title"
                    aria-describedby="modal-modal-description"
                >
                    <Box sx={modalStyle}>
                        {/*<Grid container spacing={2} className='Setting'>*/}
                        {/*    <Grid item xs={12}>*/}
                        {/*        <h2>Configuration of {objectName} [{objectKind}]</h2>*/}
                        {/*    </Grid>*/}
                        {/*    <Grid item xs={8}>*/}
                        {/*        <ReactJson src={objectOriginalJSON}/>*/}
                        {/*    </Grid>*/}
                        {/*    <Grid item xs={4}>*/}
                        {/*        <DeleteObject*/}
                        {/*            objectKind={objectKind}*/}
                        {/*            objectName={objectName}*/}
                        {/*            handleSendRequest={handleSendRequest}*/}
                        {/*        />*/}
                        {/*    </Grid>*/}
                        {/*</Grid>*/}

                        <Grid container spacing={2}>
                            <Grid xs={12} md={5} lg={4}>
                                <Item>Email subscribe section</Item>
                            </Grid>
                            <Grid container xs={12} md={7} lg={8} spacing={4}>
                                <Grid xs={6} lg={3}>
                                    <Item>
                                        <Box
                                            id="category-a"
                                            sx={{ fontSize: '12px', textTransform: 'uppercase' }}
                                        >
                                            Category A
                                        </Box>
                                        <Box component="ul" aria-labelledby="category-a" sx={{ pl: 2 }}>
                                            <li>Link 1.1</li>
                                            <li>Link 1.2</li>
                                            <li>Link 1.3</li>
                                        </Box>
                                    </Item>
                                </Grid>
                                <Grid xs={6} lg={3}>
                                    <Item>
                                        <Box
                                            id="category-b"
                                            sx={{ fontSize: '12px', textTransform: 'uppercase' }}
                                        >
                                            Category B
                                        </Box>
                                        <Box component="ul" aria-labelledby="category-b" sx={{ pl: 2 }}>
                                            <li>Link 2.1</li>
                                            <li>Link 2.2</li>
                                            <li>Link 2.3</li>
                                        </Box>
                                    </Item>
                                </Grid>
                                <Grid xs={6} lg={3}>
                                    <Item>
                                        <Box
                                            id="category-c"
                                            sx={{ fontSize: '12px', textTransform: 'uppercase' }}
                                        >
                                            Category C
                                        </Box>
                                        <Box component="ul" aria-labelledby="category-c" sx={{ pl: 2 }}>
                                            <li>Link 3.1</li>
                                            <li>Link 3.2</li>
                                            <li>Link 3.3</li>
                                        </Box>
                                    </Item>
                                </Grid>
                                <Grid xs={6} lg={3}>
                                    <Item>
                                        <Box
                                            id="category-d"
                                            sx={{ fontSize: '12px', textTransform: 'uppercase' }}
                                        >
                                            Category D
                                        </Box>
                                        <Box component="ul" aria-labelledby="category-d" sx={{ pl: 2 }}>
                                            <li>Link 4.1</li>
                                            <li>Link 4.2</li>
                                            <li>Link 4.3</li>
                                        </Box>
                                    </Item>
                                </Grid>
                            </Grid>
                            <Grid
                                xs={12}
                                container
                                justifyContent="space-between"
                                alignItems="center"
                                flexDirection={{ xs: 'column', sm: 'row' }}
                                sx={{ fontSize: '12px' }}
                            >
                                <Grid sx={{ order: { xs: 2, sm: 1 } }}>
                                    <Item>© Copyright</Item>
                                </Grid>
                                <Grid container columnSpacing={1} sx={{ order: { xs: 1, sm: 2 } }}>
                                    <Grid>
                                        <Item>Link A</Item>
                                    </Grid>
                                    <Grid>
                                        <Item>Link B</Item>
                                    </Grid>
                                    <Grid>
                                        <Item>Link C</Item>
                                    </Grid>
                                </Grid>
                            </Grid>
                        </Grid>

                </Box>
                </Modal>
            </div>
        )
    }
}

export default ViewObject
